	return (
		<ul className="nav nav-tabs nav-fill my-4">
			<li className="nav-item">
				<a className={generateLinkClass(activeTab, LIST_VIEW)} href="#">
				<IosListBox className="rounder circle"
					fontsize="30px"
					color={"#007bff"}
					style={px="10px"}
				/>列表模式</a>
			</li>
			<li className="nav-item">
				<a className={generateLinkClass(activeTab, CHART_VIEW)} href="#">图表模式</a>
			</li>
		</ul>
	)
}

export default ViewTab
